import './App.css';
import React, {Component} from 'react';
import Navbar from './components/Navbar';
import News from './components/News';

export default class App extends Component {
  render () {
    return (
      <div><Router>
        <Navbar />
        <Switch>
            <Route path="/"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/business"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/enetertainment"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/general"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/health"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/"> <News pageSize={5} country="us" category="general"/>
            </Route>
            <Route path="/"> <News pageSize={5} country="us" category="general"/>
            </Route>
        </Switch>
        <News pageSize={5} country="us" category="general"/>
        </Router>
      </div>
    );
  }
}
